import logo from './logo.svg';
import './App.css';
import { Parallax } from 'react-parallax';
import { NaviBarComponent } from './components/NavigationBar';
import Typewriter from "typewriter-effect";

function App() {
  return (
    <div className="App">
      <NaviBarComponent/>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
                <Typewriter

  onInit={(typewriter)=> {

  typewriter

  .typeString("where i'd rather be right now.")

  .pauseFor(1000)
  .deleteAll()
  .typeString("Welcomes You")
  .start();
  }}
  />
        </a>
      </header>



      <div className='parallaxBox'>
        <Parallax className='mr-auto' strength={200} renderLayer={(percentage) => (
          <div>
            <div
              style={{
                position: "absolute",
                marginLeft: "50%",
                borderRadius: "50%",
                left: "50%",
                top: "50%",
                margin: "auto",
                transform: "translate(-50%,-50%)",
                width: percentage * 500,
                height: percentage * 500,
                backgroundImage: "url('https://pbs.twimg.com/profile_images/1409628661486133248/Ne-x4N7D_400x400.jpg')",
                border: "lavender 5px solid"
              }}
            />
          </div>
        )}
        >
          <div className='insideStyles' style={{ height: 539 }}/>
          <p>Gurjit is an aspiring software developer currently studying at the University of Maryland - College Park.</p>
        </Parallax>
      </div>
    </div>
  );
}

export default App;
